import React from "react";
import marketLogo from "../../images/market_logo.svg";

import "./MarketMainHeader.css";

const MarketMainHeader = () => {
    return (
        <header id="market-main-header">
            <span>
                <img src={marketLogo} alt="" />
            </span>
        </header>
    );
}

export default MarketMainHeader;
